import{_ as a,o as e,c as t,U as o}from"./chunks/framework.97dce334.js";const p=JSON.parse('{"title":"更快速的 console.log","description":"","frontmatter":{},"headers":[],"relativePath":"Ghosteye/vs-quick-log.md","filePath":"Ghosteye/vs-quick-log.md","lastUpdated":1728876761000}'),d={name:"Ghosteye/vs-quick-log.md"},l=o('<h1 id="更快速的-console-log" tabindex="-1" data-v-73aa539a>更快速的 console.log <a class="header-anchor" href="#更快速的-console-log" aria-label="Permalink to &quot;更快速的 console.log&quot;" data-v-73aa539a>​</a></h1><p data-v-73aa539a><a href="https://github.com/xiaoyao-Ye/vs-quick-log" target="_blank" rel="noreferrer" data-v-73aa539a>项目地址</a></p><br data-v-73aa539a><p data-v-73aa539a>一个比较实用的 vscode 插件, 用于快速创建调试<code data-v-73aa539a>console.log</code>, 目前已有900+下载量, 不妨试试?</p><p data-v-73aa539a><a href="https://marketplace.visualstudio.com/items?itemName=ghosteye.vs-quick-log" target="_blank" rel="noreferrer" data-v-73aa539a><img src="https://img.shields.io/visual-studio-marketplace/v/ghosteye.vs-quick-log?color=%232ba1f1&amp;logo=visual-studio-code&amp;logoColor=%232ba1f1" alt="version" data-v-73aa539a></a><a href="https://marketplace.visualstudio.com/items?itemName=ghosteye.vs-quick-log" target="_blank" rel="noreferrer" data-v-73aa539a><img src="https://img.shields.io/visual-studio-marketplace/azure-devops/installs/total/ghosteye.vs-quick-log?label=Installs" alt="installs" data-v-73aa539a></a><a href="https://github.com/xiaoyao-Ye/vs-quick-log/stargazers" target="_blank" rel="noreferrer" data-v-73aa539a><img src="https://img.shields.io/github/stars/xiaoyao-Ye/vs-quick-log" alt="star" data-v-73aa539a></a></p><h2 id="why" tabindex="-1" data-v-73aa539a>Why? <a class="header-anchor" href="#why" aria-label="Permalink to &quot;Why?&quot;" data-v-73aa539a>​</a></h2><p data-v-73aa539a>写代码调试时经常需要输入 <code data-v-73aa539a>log</code> 生成 <code data-v-73aa539a>console.log(&#39;|&#39;, |)</code> 的代码片段然后输入需要打印的内容。这太麻烦了！</p><h2 id="features" tabindex="-1" data-v-73aa539a>Features <a class="header-anchor" href="#features" aria-label="Permalink to &quot;Features&quot;" data-v-73aa539a>​</a></h2><p data-v-73aa539a>目前已有的同类型扩展需要将光标移动到<code data-v-73aa539a>变量附近</code>, 本插件的<code data-v-73aa539a>优势是光标在当前行或者下一行</code>就能自己识别打印, 不需要刻意移动光标</p><p data-v-73aa539a><img src="https://s2.loli.net/2023/10/31/kMy7bhTZgGOaVYw.png" alt="Guide.png" data-v-73aa539a></p><p data-v-73aa539a>使用时将光标移动至打印目标所在行(或打印目标的下一行)</p><ul data-v-73aa539a><li data-v-73aa539a><code data-v-73aa539a>Ctrl + Shift + L</code> 创建 <code data-v-73aa539a>console.log</code><ul data-v-73aa539a><li data-v-73aa539a>✨ 可打印 if 语句中的条件判断</li><li data-v-73aa539a>✨ 可打印函数参数</li><li data-v-73aa539a>✨ 可打印变量</li><li data-v-73aa539a>✨ 支持选中大块区域批量打印</li><li data-v-73aa539a>✨ 设置中可配置打印当前文件名称(多文件打印同变量名称时可快速定位)</li><li data-v-73aa539a>✨ ...</li></ul></li><li data-v-73aa539a><code data-v-73aa539a>Ctrl + Shift + DELETE</code> 删除该插件创建的 <code data-v-73aa539a>console.log</code></li></ul><blockquote data-v-73aa539a><p data-v-73aa539a>支持 <code data-v-73aa539a>ts</code> <code data-v-73aa539a>tsx</code> <code data-v-73aa539a>js</code> <code data-v-73aa539a>jsx</code> <code data-v-73aa539a>vue</code> <code data-v-73aa539a>html</code> 等文件内使用。🍺enjoying!</p></blockquote>',13),s=[l];function c(i,r,v,n,h,u){return e(),t("div",null,s)}const _=a(d,[["render",c],["__scopeId","data-v-73aa539a"]]);export{p as __pageData,_ as default};
